import React from 'react';
import './App.css';
import Navbar from './components/layout/Navbar';

function App() {
  return (
    <>
      <div className="navbar-bg">
        <img src="/assets/logo.svg" />
        <div className="navbar">
          <Navbar />
        </div>
      </div>
    </>
  );
}

export default App;
